Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  ns:m.0cc8tt9 ns:time.recurring_event.instances ?x . # Stanly Cup finals instances

  {
    ?x ns:sports.sports_championship_event.champion ns:m.0j2zj . #(Boston Bruins)
  }
  UNION
  {
    ?x ns:sports.sports_championship_event.runner_up ns:m.0j2zj . #(Boston Bruins)
  }

  ?x ns:time.event.start_date ?st .
}
ORDER BY DESC(xsd:datetime(?st))
LIMIT 1
